# -*- coding: utf-8 -*-
"""NoseTests for Bear Steady Gene"""
from nose.tools import assert_equal
from gene.steady import stabilize


def test_steady_pre():
    """Bear Steady Gene: Tests against the example provided by HackerRank"""
    orig_gene = 'GAAATAAA'
    assert_equal(stabilize(8, orig_gene), 5)


def test_steady1():
    """Bear Steady Gene: Pattern #1"""
    orig_gene = 'TGATGCCGTCCCCTCAACTTGAGTGCTCCTAATGCGTTGC'
    assert_equal(stabilize(40, orig_gene), 5)


def test_steady2():
    """Bear Steady Gene: Pattern #2"""
    orig_gene = ''
    assert_equal(stabilize(1500, orig_gene), 0)


def test_steady4():
    """Bear Steady Gene: Pattern #4"""
    orig_gene = ''
    assert_equal(stabilize(150000, orig_gene), 206)


def test_steady10():
    """Bear Steady Gene: Pattern #10"""
    orig_gene = ''
    assert_equal(stabilize(500000, orig_gene), 55937)